import { Box, Container } from '@mui/system'
import React from 'react'

const ImageCarousel = () => {
  return (
    <Container maxWidth={false} disableGutters>
    <Box
        sx={{
        backgroundColor: 'gray'
        }}
    />
    </Container>

  )
}

export default ImageCarousel
